query: |-
  SELECT "t0"."mn:ORDER_DATE:ok" AS "mn:ORDER_DATE:ok",
    SUM("CUSTOMERS"."NUMBER_OF_ORDERS") AS "sum:NUMBER_OF_ORDERS:ok"
